        /// <summary>
        /// 「スキャナーを検索」ボタンがクリックされたときに実行されるメソッド
        /// </summary>
        private async void ScanDeviceButton_Click(object sender, RoutedEventArgs e)
        {
            ScannerStatusTextBlock.Text = "スキャナーを検索中...";
            scannerCombo.Items.Clear();

            // ImageScannerクラスのデバイスをすべて検索する
            string selector = ImageScanner.GetDeviceSelector();
            DeviceInformationCollection devices = await DeviceInformation.FindAllAsync(selector);

            if (devices.Count > 0)
            {
                // 見つかったデバイスをComboBoxに追加していく
                foreach (var device in devices)
                {
                    var item = new ComboBoxItem
                    {
                        Content = device.Name, // スキャナーの表示名
                        Tag = device.Id        // 接続に使うための一意なID
                    };
                    scannerCombo.Items.Add(item);
                }

                // 最初のスキャナーを自動的に選択状態にする
                scannerCombo.SelectedIndex = 0;
                ScannerStatusTextBlock.Text = $"{devices.Count}台のスキャナーが見つかりました。";
            }
            else
            {
                // スキャナーが見つからなかった場合
                ScannerStatusTextBlock.Text = "利用可能なスキャナーが見つかりませんでした。";
            }
        }
        /// <summary>
        /// 「スキャン実行」ボタンがクリックされたときの処理
        /// </summary>
        private async void ExecuteScanButton_Click(object sender, RoutedEventArgs e)
        {
            // 1. 選択されているスキャナーを取得
            var selectedItem = scannerCombo.SelectedItem as ComboBoxItem;
            if (selectedItem == null)
            {
                ScannerStatusTextBlock.Text = "スキャナーが選択されていません。";
                return;
            }

            // Tagに保存したスキャナーのIDを取得
            string scannerDeviceId = selectedItem.Tag.ToString();

            try
            {
                ScannerStatusTextBlock.Text = "スキャナーに接続しています...";

                // 2. スキャナーに接続する
                ImageScanner scanner = await ImageScanner.FromIdAsync(scannerDeviceId);

                // スキャナーが設定（プレビュー）に対応しているかなどを確認
                if (scanner == null)
                {
                    ScannerStatusTextBlock.Text = "スキャナーに接続できませんでした。";
                    return;
                }

                // 3. スキャンしたファイルを保存する一時フォルダを準備
                StorageFolder tempFolder = ApplicationData.Current.TemporaryFolder;

                ScannerStatusTextBlock.Text = "スキャンを実行中... スキャナードライバの画面が表示される場合があります。";

                // 4. スキャンを実行し、ファイルをフォルダに保存
                var result = await scanner.ScanFilesToFolderAsync(ImageScannerScanSource.Default, tempFolder);

                // 5. スキャン結果を確認し、画像を表示
                if (result.ScannedFiles.Count > 0)
                {
                    StorageFile scannedFile = result.ScannedFiles[0]; // 最初のファイルを取得

                    // ファイルを読み込んでBitmapImageに変換
                    var bitmapImage = new BitmapImage();
                    using (var stream = await scannedFile.OpenAsync(FileAccessMode.Read))
                    {
                        await bitmapImage.SetSourceAsync(stream);
                    }

                    // Imageコントロールに画像を表示
                    ScannedImage.Source = bitmapImage;
                    ScannerStatusTextBlock.Text = $"スキャンが完了しました: {scannedFile.Name}";

                    // WebView2に画像を送信
                    await SendImageToWebViewAsync(scannedFile);
                }
                else
                {
                    ScannerStatusTextBlock.Text = "スキャンは実行されましたが、画像ファイルは作成されませんでした。";
                }
            }
            catch (Exception ex)
            {
                // 何かエラーが起きた場合
                ScannerStatusTextBlock.Text = "エラーが発生しました: " + ex.Message;
            }
        }

        /// <summary>
        /// 指定された画像ファイルをBase64に変換し、WebView2内のJavaScript関数を呼び出す
        /// </summary>
        /// <param name="imageFile">スキャンされた画像ファイル</param>
        private async System.Threading.Tasks.Task SendImageToWebViewAsync(StorageFile imageFile)
        {
            if (imageFile == null || MyWebView.CoreWebView2 == null)
            {
                return;
            }

            try
            {
                // 1. ファイルをバイト配列に読み込む
                IBuffer buffer = await FileIO.ReadBufferAsync(imageFile);
                byte[] bytes = buffer.ToArray();

                // 2. バイト配列をBase64文字列に変換
                string base64String = Convert.ToBase64String(bytes);

                // 3. JavaScriptで使えるようにデータURI形式の文字列を作成
                //    'data:image/jpeg;base64,' の部分はファイルの形式に合わせて変更可能
                string dataUriString = $"data:image/jpeg;base64,{base64String}";

                // 4. 呼び出すJavaScriptコードを生成
                //    文字列はシングルクォートで囲む
                string script = $"displayScannedImage('{dataUriString}')";

                // 5. WebView2上でJavaScriptを実行
                await MyWebView.CoreWebView2.ExecuteScriptAsync(script);

                System.Diagnostics.Debug.WriteLine("WebView2に画像を送信しました。");
            }
            catch (Exception ex)
            {
                System.Diagnostics.Debug.WriteLine("WebView2への画像送信中にエラー: " + ex.Message);
            }
        }

        /// <summary>
        /// このページがフレームに表示されるときに呼び出されます。
        /// 印刷関連のオブジェクトを初期化します。
        /// </summary>
        protected override void OnNavigatedTo(NavigationEventArgs e)
        {
            base.OnNavigatedTo(e);

            // PrintManagerのインスタンスを取得し、イベントハンドラを登録
            printManager = PrintManager.GetForCurrentView();
            printManager.PrintTaskRequested += PrintTaskRequested;

            // PrintDocumentのインスタンスを作成し、イベントハンドラを登録
            printDocument = new PrintDocument();
            printDocumentSource = printDocument.DocumentSource;
            printDocument.Paginate += Paginate;
            printDocument.GetPreviewPage += GetPreviewPage;
            printDocument.AddPages += AddPages;
        }

        /// <summary>
        /// このページがフレームから移動するときに呼び出されます。
        /// リソースリークを防ぐためにイベントハンドラを解除します。
        /// </summary>
        protected override void OnNavigatedFrom(NavigationEventArgs e)
        {
            base.OnNavigatedFrom(e);

            if (printManager != null)
            {
                printManager.PrintTaskRequested -= PrintTaskRequested;
            }

            if (printDocument != null)
            {
                printDocument.Paginate -= Paginate;
                printDocument.GetPreviewPage -= GetPreviewPage;
                printDocument.AddPages -= AddPages;
            }
        }

        /// <summary>
        /// プリント実行ボタンのクリックイベントハンドラ
        /// </summary>
        private async void ExecutePrintButton_Click(object sender, RoutedEventArgs e)
        {
            PrintStatusTextBlock.Text = "印刷イメージを取得しています...";
            try
            {
                // Base64形式のドキュメントを取得するモック関数を呼び出し
                string base64Image = await GetDocumentAsBase64Async();
                if (string.IsNullOrEmpty(base64Image))
                {
                    // GetDocumentAsBase64Async内でエラーメッセージは設定済み
                    return;
                }

                // Base64文字列をバイト配列に変換
                byte[] imageBytes = Convert.FromBase64String(base64Image);

                // バイト配列からBitmapImageを作成し、印刷ソースとして設定
                using (InMemoryRandomAccessStream stream = new InMemoryRandomAccessStream())
                {
                    await stream.WriteAsync(imageBytes.AsBuffer());
                    stream.Seek(0);
                    _imageToPrint = new BitmapImage();
                    await _imageToPrint.SetSourceAsync(stream);
                }

                PrintStatusTextBlock.Text = "印刷ダイアログを表示しています...";

                // UWPの標準印刷UIを表示します。
                // このメソッドが呼び出されると、PrintManagerのPrintTaskRequestedイベントが発生します。
                await PrintManager.ShowPrintUIAsync();
            }
            catch (Exception ex)
            {
                // 印刷ダイアログの表示に失敗した場合の処理
                PrintStatusTextBlock.Text = $"印刷処理中にエラーが発生しました: {ex.Message}";
            }
        }

        /// <summary>
        /// PrintManagerが印刷タスクを要求したときに発生するイベントハンドラ
        /// </summary>
        private void PrintTaskRequested(PrintManager sender, PrintTaskRequestedEventArgs args)
        {
            // PrintTaskを作成し、印刷するコンテンツのソースとタスク名を指定します。
            PrintTask printTask = args.Request.CreatePrintTask("ScannerApp Print", sourceRequested =>
            {
                // 印刷ドキュメントのソースを設定します。
                sourceRequested.SetSource(printDocumentSource);
            });

            // 印刷タスクの完了イベントハンドラを登録
            printTask.Completed += PrintTask_Completed;
        }

        /// <summary>
        /// 印刷ジョブが完了、キャンセル、または失敗したときに呼び出されます。
        /// </summary>
        private async void PrintTask_Completed(PrintTask sender, PrintTaskCompletedEventArgs args)
        {
            await Dispatcher.RunAsync(CoreDispatcherPriority.Normal, () =>
            {
                PrintStatusTextBlock.Text = $"印刷ジョブの状態: {args.Completion}";
            });
        }

        /// <summary>
        /// 印刷ドキュメントのページ分割が必要な場合に呼び出されます。
        /// </summary>
        private void Paginate(object sender, PaginateEventArgs e)
        {
            // 今回は1ページのみ印刷
            printDocument.SetPreviewPageCount(1, PreviewPageCountType.Final);
        }

        /// <summary>
        /// 印刷プレビューのページを描画するために呼び出されます。
        /// </summary>
        private void GetPreviewPage(object sender, GetPreviewPageEventArgs e)
        {
            // 印刷用に準備したデータからプレビューページを生成します。
            // これにより、UIの表示とは独立した印刷データがプレビューされます。
            if (_imageToPrint != null)
            {
                Image printImage = new Image();
                printImage.Source = _imageToPrint;
                printDocument.SetPreviewPage(e.PageNumber, printImage);
            }
        }

        /// <summary>
        /// 実際の印刷のためにページを追加するために呼び出されます。
        /// </summary>
        private void AddPages(object sender, AddPagesEventArgs e)
        {
            // 印刷用に準備したデータから印刷ページを生成します。
            if (_imageToPrint != null)
            {
                Image printImage = new Image();
                printImage.Source = _imageToPrint;
                printDocument.AddPage(printImage);
            }

            // すべてのページの追加が完了したことを通知
            printDocument.AddPagesComplete();
        }

        /// <summary>
        /// WebView内の 'ps-image-preview' 要素からBase64形式の画像データを取得します。
        /// </summary>
        /// <returns>Base64エンコードされた画像の文字列</returns>
        private async Task<string> GetDocumentAsBase64Async()
        {
            if (MyWebView.CoreWebView2 == null)
            {
                return string.Empty;
            }

            try
            {
                // WebView内の 'ps-image-preview' というidを持つimg要素のsrc属性を取得するJavaScript
                string script = "document.getElementById('ps-image-preview').src;";

                // JavaScriptを実行し、結果（データURI文字列）を取得
                string dataUriString = await MyWebView.CoreWebView2.ExecuteScriptAsync(script);

                // ExecuteScriptAsyncは結果をJSON文字列（例: "\"data:image/jpeg...\""）で返すので、
                // nullチェックと前後のダブルクォートの削除を行う
                if (dataUriString == null || dataUriString == "null")
                {
                    PrintStatusTextBlock.Text = "プレビュー画像が見つかりません。";
                    return string.Empty;
                }
                dataUriString = dataUriString.Trim('"');

                // データURI（例: "data:image/png;base64,iVBORw0KGgo...")からカンマを探し、
                // それ以降のBase64データ部分だけを抽出する
                int commaIndex = dataUriString.IndexOf(',');
                if (commaIndex > 0 && commaIndex + 1 < dataUriString.Length)
                {
                    // カンマの次の文字から最後までがBase64データ
                    string base64Data = dataUriString.Substring(commaIndex + 1);
                    return base64Data;
                }
                else
                {
                    PrintStatusTextBlock.Text = "画像のデータ形式が正しくありません。";
                    return string.Empty;
                }
            }
            catch (Exception ex)
            {
                PrintStatusTextBlock.Text = $"WebViewからの画像取得中にエラーが発生しました: {ex.Message}";
                return string.Empty;
            }
        

        //// これはdummy。単純な100x50の青い長方形のPNG画像のBase64表現です。
        //string dummyPngBase64 = "";
        //    return Task.FromResult(dummyPngBase64);


        }

